(74525, 'A1D37129-35C7-41DE-8371-AB5FDB18CE63', 'Hi my love. First, just want to say thank you for your graciousness in having a night out with Ramy. I️’m excited to see him for a few hours and then to come back home to your loving arms and be with my one and only soul mate. I️’m beyond grateful that we have this set up and that we continue to put the time and energy into making it work. It gives me great joy to have an occasional night out with a lover and then to come back home and bask in my appreciation for us and what we have together. Second, I️ wanted to apologize again for not being more thoughtful about your books. I️ didn’t know you wanted to hold onto them and should have asked. My sincere apologies for that.  See you at around 11! Love you to the moon and back. ', 'Nitzan', 'David', '2023-12-03T17:33:44.959307'),
